          <p>Приложение React следует немного модифицированному архитектурному паттерну MVC. Описанные выше компоненты реализуют Представления (thick views, что значит, что они не только отображают данные, но и имеют какую-то собственную логику и возможность изменений). Модель приложения реализована с помощью хранилища Redux. Модель иммутабельна, и может быть с помощью редюсеров заменена на новую модель в случае необходимости изменений. Контроллерами являются встроенные функции отправки действий (dispatch actions) в хранилище, а также прослойки (middleware), которые позволяют добавлять собственную логику в контроллеры, например для отправки действий на сторонний сервер, обработки результата, работу с БД и так далее.</p>
